import logo from './../../images/logo.png';
import './AdminLogin.css';
import React, {useEffect, useState } from 'react';
import { loginAPI } from '../../api/loginAPI';
import { setUserSession } from '../../utils/Common';

function AdminLogin(props){
        const [adminLogin, setAdminLogin] = useState({
            username: '',
            password: '',
        })

        function handleChange(event){
            const target = event.target;
            const name = target.name;
            const value = target.value;
            setAdminLogin({
                ... adminLogin,
                [name] : value,
            })
        }
        useEffect(()=>{
            async function handleSubmit(e){
                e.preventDefault();
                try {
                    const params = {email: adminLogin.username, password: adminLogin.password};
                    const response = await loginAPI.loginAdmin(params);
                    console.log(response.data);
                    setUserSession(response.data.token, response.data);
                    props.history.push('/admin-manager');
                } catch (error) {
                    console.log(error);
                }
            }
            handleSubmit();
        },[])

        return (
            <div className="bg">
                <img src={logo} alt=""/>
                <h3/>
                <form className="form" onSubmit={useEffect}>
                    <div className="form-group">
                        <input type="text" className="form-control" name="username" onChange={handleChange} placeholder="Username"/>
                    </div>
                    <div className="form-group">
                        <input type="password" className="form-control" name="password" onChange={handleChange} placeholder="Password"/>
                    </div>
                    <button type="submit" className="btn btn-primary btn-block btn-large">Login</button>
                </form>
            </div>
        );
    }

export default AdminLogin;
